import React from "react";
import Card from "./card";

function App() {
    return(
        <>
          <Card />
          <br />
          <br />
          <br />
          <br />
          <h2>Every thing is going well</h2>
          <br />
          <br />
          <br />
          <br />
          <br />
          <Card message="these are all guys going well"/>

        </>
    );
}

export default App;
